rule wishfulwoodchuck_CheckKeystrokeValue
{
    meta:
        author = "NCSC"
        description = "Keystroke comparison code from binary"

	strings:
		// mov     eax, [ebp+1504h+var_1520]
		// mov     eax, [eax]
		// cmp     eax, 0A1h 	
		// jz      short loc_10002A89
		// cmp     eax, 0A0h 		
		// jz      short loc_10002A89
		// cmp     eax, 0A3h 		
		// jz      short loc_10002A89
		// cmp     eax, 0A2h 
	
		$1 = {8B ?? ?? 8B 00 3D A1 00 00 00 74 ?? 3D A0 00 00 00 74 ?? 3D A3 00 00 00 74 ?? 3D A2 00 00 00}                                  
                           	
	condition:
		uint16(0) == 0x5A4D and
		uint32(uint32(0x3c)) == 0x00004550 and
		all of them
}

